package workout;

public class Switchdemo {

	public static void main(String[] args)  {
		int i;
		for(i = 0; i < 10; i++)
			switch(i){
			case 0:
				System.out.println(i);
				break;
			case 1:
				System.out.println(i);
				break;
			case 2:
				System.out.println(i);
				break;
			case 3:
				System.out.println(i);
				break;
			case 4:
				System.out.println(i);
				break;
			default:
				System.out.println("its more than four");
				
				
			}
		// TODO Auto-generated method stub

	}

}
